import React from 'react';
import './App.css';
import LoginPage from './LoginPage';
import Home from './Home';
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from "react-router-dom";


function App() {
  return (
    <Router> 
      <div className="App">
        <Switch>
          <Route exact={true} path="/" componenet={Home}/>
          <Route exact={true} path="/" componenet={Home}/>
          <Route path="/login" componenet={LoginPage}/>
        </Switch>
      </div>
    </Router>
  );
}

export default App;
